{
  "version": "0.2",
  "phases": {
    "build": {
      "commands": [
        "npm install -g aws-cdk",
        "python -m pip install -r requirements.txt",
        "cdk synth"
      ]
    }
  },
  "artifacts": {
    "base-directory": "cdk.out",
    "files": "**/*"
  }
}

{
  "version": "0.2",
  "phases": {
    "build": {
      "commands": [
        "python -m pip install aws-cdk-lib",
        "python -m pip install -r requirements-dev.txt",
        "pytest tests/unit/test_pat_dowd_stack.py -v"
      ]
    }
  }
}
